import React, { useState } from "react";
import { Link } from "react-router-dom";
import Typewrier from "typewriter-effect";

function Home() {
  const [instructiune, setInstructiune] = useState(false);

  return (
    <>
      <div className="fullPage ">
        <div className="thoborBackground">
          <div className="banner">
            <h1>
              <Typewrier
                onInit={(type) => {
                  type
                    .typeString(
                      "Bine ai venit la tresure hunt-ul organizat de Thobor"
                    )
                    .start();
                }}
              />
            </h1>
          </div>
        </div>

        {instructiune && <div className="info">
        <i class="far fa-times-circle" onClick={()=>setInstructiune(false)}></i>
        </div>}

        <div className="optiuni">
          <div className="start o">
            <h2>
              <Link to>Start</Link>
            </h2>
          </div>
          <div className="instructiuni o">
            <h2
              onClick={() => {
                setInstructiune(true);
              }}
            >
              instructiuni
            </h2>
          </div>
        </div>
      </div>
    </>
  );
}

export default Home;
